import React from 'react';
import {GoogleApiWrapper, Map} from 'google-maps-react';


class HeatMap extends React.Component {

    toronto = {
        lng: 79.3832,
        lat: -43.6532
    }

    static defaultProps = {
        center : this.toronto,
        zoom : 6
    };

    render() {
        const mapStyles = {
            width: '100%',
            height: '100%',
          };
        return(
            <div style={{ height: '100vh', width: '100%' }}>
                <Map
                    google={this.props.google}
                    zoom={4}
                    style={mapStyles}
                    initialCenter={this.toronto}
                />
            </div>
        )
    }
}


export default GoogleApiWrapper({
    apiKey: "AIzaSyDtxAtICzrgcWE9ntlfGjudzCdNzY7IN5c"
})(HeatMap);
